    false,nt"url": null,nt"notes": "This dataset has recent, preliminary (not
    quality-controlled), 1-minute, water leveln(tide) data from NOAA NOS Center for
    Operational Oceanographic Products and Servicesn(CO-OPS).nnWARNING: These raw data
    have not been subjected to the National Ocean Service'snquality control or quality
    assurance procedures and do not meet the criteria andnstandards of official National
    Ocean Service data. They are released for limitednpublic use as preliminary data
    to be used only with appropriate caution.nnWARNING:n* Queries for data MUST include
    stationID=, datum=, and time>=.n* Queries for data USUALLY include time<=.n* Queries
    MUST be for less than 30 days worth of data.n  The default time<= value corresponds
    to 'now'.n* Different stations support different datums.n  Use ERDDAP's Subset web
    page to find out which datums a given station supports.n* The data source isn't
    completely reliable. If your request returns no datan  when you think it should:n
     * Make sure the station you specified supports the datum you specified.n  * Try
    revising the request (e.g., a different datum or a different time range).n  * The
    list of stations offering this data (or the list of datums) may be incorrect.n  *
    Sometimes a station or the entire data service is unavailable.n    Wait a while
    and try again.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
